import React, { useEffect, useState } from 'react'
import './styles.css'
import Block1 from './Block1/index'
import { getInfo } from '../../services/requests'

function Index() {
  const [coursesData, setcoursesData] = useState(null)

  useEffect(() => {
    getInfo().then(res => {
      setcoursesData(res.data[0].courses)
    })
  }, [])

  return (
    <div>
      <h1 className='tittleActivity'>Meus cursos</h1>
      <div className='stylesBlock'>
        {coursesData ? (
          <>
            <Block1
              graduation='Graduação'
              course1={coursesData[0].course}
              class='M52'
              image='https://i.imgur.com/dSG2ZLX.jpg'
            />
            <Block1
              graduation='Graduação'
              course1='Projeto de Banco de Dados'
              class='M52'
              image='https://i.imgur.com/GpfCzWB.jpg'
            />
          </>
        ) : (
          <p>Carregando</p>
        )}
      </div>
    </div>
  )
}

export default Index
